import React from 'react';

const UserDashboard = ({ user, favorites, spaces }) => {
  const userFavorites = spaces.filter((space) => favorites.includes(space.id));

  return (
    <div className="container mx-auto p-8">
      <h1 className="text-3xl font-bold mb-4">Dashboard de Usuario</h1>
      <p>Bienvenido, {user?.name || 'Usuario'}</p>

      <h2 className="text-2xl font-bold mt-6">Espacios Favoritos</h2>
      <div className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 gap-6">
        {userFavorites.length > 0 ? (
          userFavorites.map((space) => (
            <div key={space.id} className="p-4 border rounded shadow-sm">
              <h3 className="text-lg font-bold">{space.name}</h3>
              <p>{space.description}</p>
            </div>
          ))
        ) : (
          <p>No tienes espacios favoritos.</p>
        )}
      </div>
    </div>
  );
};

export default UserDashboard;
